import React from 'react';
import './App.scss';
import Experiences from './components/Experiences';
import logo from './images/logo.svg'; 
import image1 from './images/image1.jpg';
import image2 from './images/image2.jpg';
import image3 from './images/image3.jpg';
import image4 from './images/image4.jpg';
import image5 from './images/image5.png';
import image6 from './images/image6.jpg';
import image7 from './images/image7.jpg';
import image8 from './images/image8.jpg';
import image9 from './images/image9.png';
import image10 from './images/image10.jpg';



const App: React.FC = () => {
  const imageList = [
    { 
      src: image1, 
      alt: 'Description of Image 1', 
      projectName: 'Becoming an Xplorer', 
      companyName: 'XPLOR' 
    },
    { 
      src: image2, 
      alt: 'Description of Image 2', 
      projectName: 'Getting Onboard', 
      companyName: 'SURF' 
    },
    { 
      src: image3, 
      alt: 'Description of Image 2', 
      projectName: 'Unearthing ', 
      companyName: 'SURF' 
    },
    { 
      src: image4, 
      alt: 'Description of Image 2', 
      projectName: 'Getting Onboard', 
      companyName: 'SURF' 
    },
    // ...add more images as needed
  ];

  return (
    <div className="App">
      <header className="App-header">
        <div className="container">
          <div className="navigation-bar">
            <img src={logo} alt="Logo" className="logo" />
            <button className="button">GET IN TOUCH</button>
          </div>
        </div>
      </header>
      <main className="main">
        <h1 style={{ fontSize: '30px', fontFamily: 'Amiri, sans-serif', color: '#333333', fontWeight: 'normal' }}>
          Hi there, I'm Nilay. Put simply, I love building things.
        </h1>
        <h2 style={{ fontWeight: 'bold', fontFamily: 'Amiri, sans-serif', fontSize: '30px' }}>
          Here's (most of) my work so far.
        </h2>
      </main>
      <div className="selected-work">
        <h2>SELECTED WORK</h2>
      </div>
      <Experiences images={imageList} />
    </div>
  );
}

export default App;
